// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awThemeSwitchRenderFunction } from 'js/AwThemeSwitchService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwThemeSwitchService', () => import('js/AwThemeSwitchService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awThemeSwitchRenderFunction",
            "deps": "js/AwThemeSwitchService"
        },
        "updateTheme": {
            "actionType": "JSFunction",
            "method": "updateTheme",
            "inputData": {
                "theme": "{{ctx.theme}}"
            },
            "deps": "js/AwThemeSwitchService"
        }
    },
    "ctx": {
        "theme": null
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onUpdate": {
            "action": "updateTheme",
            "observers": [
                "viewModel.ctx.theme"
            ]
        }
    },
    "_viewModelId": "AwThemeSwitch",
    "_uniqueViewModelId": "AwThemeSwitch"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awThemeSwitchRenderFunction, undefined, ctxImportObj );

export default Component;
